        function OpenPrintPage(url, winName) {
            var windowHeight = 800;
            var windowWidth = 850;

            var reportViewerHeight = windowHeight - 15;
            var reportViewerWidth = windowWidth - 30;
            
            var data = "width=" + windowWidth + "px,height=" + windowHeight + "px,scrollbars=1,resizable=1,location=0,menubar=1";
            if (url.split('?').length == 1) {
                var childWin = window.open(url + "?time=" + Math.random() + "&h=" + reportViewerHeight + "&w=" + reportViewerWidth, winName, data);
            }
            else {
                var childWin = window.open(url + "&time=" + Math.random() + "&h=" + reportViewerHeight + "&w=" + reportViewerWidth, winName, data);
            }
            if (window.focus&&childWin!=null) {
                childWin.focus();
            }
        }

